(5, 'M01', 'Matematika', 'SMP', 'Rumah di Jalan Veteran dinomori secara urut mulai 1 sampai dengan 150. Berapa banyak rumah yang nomornya menggunakan angka 8 sekurang-kurangnya satu kali?', '14', '15', '21', '24', '24'),
(6, 'F01', 'Fisika', 'SMP', 'Jika kecepatan rata-rata sebuah benda sama dengan nol, maka...', 'benda bergerak dengan kecepatan tetap', 'jarak yang ditempuhnya sama dengan nol', 'benda bergerak bolak-balik', 'perpindahan benda itu sama dengan no!', 'benda bergerak bolak-balik'),
(7, 'F01', 'Fisika', 'SMP', 'Seorang sopir seding mengendarai sebuah mobil yang bergerak dengan kecepatan tetap 25 m/s. Ketika sopir melihat seorang anak yang tiba-tiba menyeberang jalan, diperlukan waktu 0,10 s bagi sopir untuk bereaksi dan mengerem. Akibatnya, mobil melambat dengan percepatan tetap 5,0 m/ s^2 dan berhenti. Jarak total yang ditempuh mobil tersebut sejak sopir melihat anak menyeberang hingga mobil berhenti adalah', '37,00 m', '11,00 m', '38,25 m', '48,00 m', '38,25 m'),
(8, 'F01', 'Fisika', 'SMA', 'Suhu gas nitrogen pada saat kelajuan rms-nya (root mean square) sama dengan v1 adalah 300 K. Jika kelajuan rms gas nitrogen diperbesar menjadi dua kali dan v1, maka suhu gas nitrogen tersebut berubah menjadi...', '425 k', '600 k', '1146 k', '1200 k', '600 k'),
(9, 'F01', 'Fisika', 'SMA', 'Sebuah mesin Carnot menyerap panas dari tandon panas bertemperatur 127 C dan membuang sebagian panasnya ke tandon dingin bertemperatur 27 C. Efisiensi terbesar yang dapat dicapai oleh mesin Carnot tersebut adalah...', '20,5%', '25%', '70,25%', '90,7%', '70,25%'),
