(11, 'K01', 'Kimia', 'SMA', 'Pada suhu 100 C, 2-butanol direaksikan dengan asam sulfat pekat. HasH reaksi ini direaksikan dengan gas hidrogen berbantuan katalis Pt.Senyawa yang diperoleh dari reaksi tersebut adalah .... ', '1-butena', '2-butena', 'butana', 'metil-propana', 'metil-propana'),
(12, 'K01', 'Kimia', 'SMA', 'Diketahui potensial reduksi standar berikut: Cr3+(aq) + 3e menjadi Cr(s)	E°= - 0,74 V \r\nMn04-(aq) + 8W +5e menjadi mn2''(aq) + 4H20 E° = + 1,51 V\r\nPotensial set standar dari set Galvani yang dibuat dengan menggabungkan kedua setengah reaksi di atas adalah...\r\n', '-2,25V', '0,75V', '+0,75V', '+2,25V', '+2,25V'),
(13, 'K01', 'Kimia', 'SMA', 'Pada tekanan I atmosfor, larutan sukrosa (C12H22011) dalam air memiliki titik didih 101°C, Jika Kb air = 0,5°C/m, maka konsentrasi larutan tersebut adalah...', '1,0 moial', '2,0 moial', '2,5 moial', '4,5 moial', '2,5 moial'),
