(15, 'K01', 'Kimia', 'SMP', 'Dalam Sistem Berkala Unsur, unsur X terletak pada periode ketiga dan golongan 15 atau VA. Dalam keadaan ion, unsur ini isoelektronik dengan unsur gas mulia priode ketiga. Muatan ion X adalah...', '1-', '2-', '3-', '2+', '3-'),
(16, 'B01', 'Biologi', 'SMA', 'Pernyataan yang benar tentang keberhasilan proses evolusi konvergensi adalah...', 'spesies yang berkerabat jauh tampak sekerabat dekat', 'spesies sama yang menempati lingkungan berbeda', 'memiliki organ tubuh yang secara anatomi sama', 'fungsi organ tubuh berbeda meskipun secara anatomi sama', 'memiliki organ tubuh yang secara anatomi sama'),
