(25, 'G01', 'Geografi', 'SMA', 'Wilayah di Indonesia yang memiliki tingkat kerawanan tinggi terhadap bencana gempa bumi adalah...', 'Aceh, Pontianak, dan Yogyakarta.', 'Padang, Riau, dan Denpasar.', 'Lampung, Bangka, dan Sumbawa.', 'Nias, Lombok, dan Maluku Utara.', 'Nias, Lombok, dan Maluku Utara.'),
(26, 'E01', 'Ekonomi', 'SMA', 'Jika meningkatnya harga barang Y menyebabkan menurunnya permintaan barang X, maka...', 'X dan Y merupakan barang substitusi', 'X dan Y merupakan barang komplementer', 'X dan Y, masing-masing merupakan barang inferior dan normal', 'X dan Y, masing-masing merupakan barang normal dan inferior', 'X dan Y merupakan barang komplementer'),
(27, 'E01', 'Ekonomi', 'SMA', 'Apabila harga beras mengalami peningkatan secara terus-menerus, bentuk intervensi pasar yang dapat dilakukan pemerintah adalah menetapkan...', 'ceiling price tanpa diikuti operasi pasar.', 'floor price tanpa diikuti pemberian subsidi.', 'ceiling price diikuti pemasokan beras melalui operasi pasar.', 'floor price diikuti pemasokan beras melalui operasi pasar.', 'ceiling price diikuti pemasokan beras melalui operasi pasar.'),
(28, 'E01', 'Ekonomi', 'SMA', 'Pengangguran yang disebabkan kesenjangan antara pencari kerja dengan lowongan kerja seperti waktu, informasi ataupun kondisi geografis, disebut pengangguran...', 'struktural', 'siklis', 'musiman', 'friksional', 'friksional'),
(29, 'E01', 'Ekonomi', 'SMA', 'Produk Domestik Bruto (PDB) adalah nilai barang dan jasa yang dihasilkan oleh', 'penduduk negara asing di suatu negara.', 'penduduk suatu negara di negaranya sendiri.', 'pendidik negara sendiri dengan penduduk negara lain di negara tersebut.', 'penduduk negara sendiri dan negara asing.', 'pendidik negara sendiri dengan penduduk negara lain di negara tersebut.'),
(30, 'E01', 'Ekonomi', 'SMA', 'Diketahui persediaan awal barang dagangan sebesar Rp15.600.000,00. Pembelian barang dagangan sebesar Rp14.400.000,00; beban angkutan pembelian Rp1.750,00; upah bongkar¬muat dan asuransi masing-masing sebesar Rp2.250.000,00 dan Rp1.500.000,00. Jika persediaan akhir barang dagangan sebesar Rp3.875.500,00, maka besarnya harga pokok penjualan adalah...', 'Rp16.024.500,00.', 'Rp26.124.500,00.', 'Rp30.000.000,00.', 'Rp31.624.500,00.', 'Rp31.624.500,00.'),
(31, 'S01', 'Sosiologi', '', 'Sikap yang menyebabkan terjadinya kecintaan yang mendalam terhadap suatu kelompok sosial segingga menimbulkan permusuhan atau ke¬bencian pada kelompok sosial yang lain adalah...', 'primary dan secondary groups.', 'casual dan panic groups.', 'private dan exclusive filling.', 'in-group dan out-groups.', 'in-group dan out-groups.'),
(32, 'S01', 'Sosiologi', '', 'Norma sosial dapat diurutkan dari yang lemah sampai yang kuat berdasarkan kekuatan mengikatnya seperti yang tercermin pada hubungan...', 'usage-folkways-custom-mores.', 'custom-usage-folkways-mores.', 'mores-custom-usage-folkways.', 'usage-folkways-mores-custom.', 'usage-folkways-mores-custom.'),
(33, 'S01', 'Sosiologi', '', 'Menurut Charles Horton Cooley pembentukan diri seseorang terjadi melalui looking-glass self. Dalam proses tersebut penanda terbentuknya diri adalah...', 'peniruan peran yang dijalankan oleh orang tuanya atau orang yang paling sering berinteraksi deng', 'kemampuan mengambil peran orang lain secara lebih luas.', 'kesadaran akan peran yang ia jalankan dan peran yang dijalankan orang lain.', 'kemampuan menjadi diri sendiri.', 'kemampuan menjadi diri sendiri.'),
(34, 'S01', 'Sosiologi', '', 'Mobilitas sosial horisontal merupakan peralihan individu dari suatu kelompok sosial ke kelompok lain yang sederajat. Berikut ini adalah contoh mobilitas sosial horisontal, kecuali...', 'beralih kewarganegaraan.', 'rotasi pekerjaan.', 'berganti keyakinan.', 'promosi jabatan.', 'promosi jabatan.'),
(35, 'S01', 'Sosiologi', '', 'Penyebab terjadinya perspektif konflik yang memandang kelas-kelas di masyarakat memiliki potensi konflik yang inheren adalah', 'tiap-tiap kelas memiliki kepentingan yang sama.', 'tiap-tiap kelas terbentuk karena memiliki alat/ kekayaan produktif,', 'tiap-tiap kelompok menginginkan masyarakat tanpa kelas.', 'ada kelas yang menguasai alat produksi ada pula yang tidak', 'ada kelas yang menguasai alat produksi ada pula yang tidak'),
(36, 'R01', 'Bahasa Inggris', '', 'The murder  …. yet though people really hope the murderer ….', 'has not solved – catch', 'has not to solve – caught', 'has not to be solved – be caught', 'has not been solved – to be caught', 'has not been solved – to be caught'),
(37, 'R01', 'Bahasa Inggris', '', 'Eddy         : This room …….every day. This seems no dust on it. It’s so shiny\r\nRoy           :  I think so', 'can be very clean', 'must be cleaned', 'must be extremely clean', 'may so clean', 'must be cleaned'),
(38, '', '', '', ' “Soon realizing what he had done, he (became) very frightened and started crying ” The underlined word in the sentence above can be classified into….', 'verbal verb', 'relational verb', 'existential verb', 'behavioral verb', 'existential verb'),
(39, 'R01', 'Bahasa Inggris', '', 'Nanda       : To tell you the truth, I am not too bad to fix this radio\r\nCindy        : Really? So it means I needn’t have it repaired\r\nIn the dialogue, Nanda expresses his  ….  to do something', 'capability', 'badness', 'frankness', 'feeling', 'capability'),
(40, 'R01', 'Bahasa Inggris', '', ' Fred                 : I ….. a John M Echol’s dictionary\r\nShop assistant       : Yes. It’s over there. Let me take it for you.', 'I want', 'I need to know', 'I’ve got to  see', 'What I really like is', 'I want'),
(41, 'N01', 'Bahasa Indo', '', 'Cermati paragraf rumpang berikut ini!\r\nSeberapa penting dan menentukankah pelemahan nilai tukar rupiah terhadap kehidupan masyarakat? ……….berlebihan kalau kita katakan………..pengaruh itu tidak ada. Pelemahan nilai tukar yang terus terjadi menimbulkan efek psikologis yang tidak baik. Apalagi, masyarakat pernah merasakan pengalaman pahit…………nilai terpuruk sehingga mengakibatkan barang-barang menghilang dari pasaran. ………….ada, harganya tidak terjangkau lagi.\r\nKata penghubung yang tepat untuk melengkapi paragraf rumpang tersebut adalah…', 'Tentu saja, kalau, begitu, barangkali', 'Tentunya, bahwa, ketika, kalau', 'Namun, ketika, begitu, barangkali', 'Oleh karena itu, seandainya, selama, ketika', 'Tentunya, bahwa, ketika, kalau'),
(42, 'N01', 'Bahasa Indo', '', ' (1) Dapat pula dikemukakan bahwa dalam paragraf yang kohesif tidak terdapat\r\nkalimat yang saling bertentangan. (2) Kohesif bermakna kepaduan. (3) Paragraf yang kohesif adalah paragraf yang hubungan antar kalimatnya padu atau berjalinan erat. (4) Kepaduan itu ditandai dengan terciptanya saling mendukung antara kalimat yang satu dengan kalimat yang lainnya. (5) Lebih jelas lagi dapat dikatakan bahwa paragaraf yang kohesif ditandai dengan tidak terjadinya saling mengingkari antara kalimat satu dengan kalimat lainnya.\r\nKalimat-kalimat tersebut akan menjadi paragraf yang padu apabila disusun dengan\r\nurutan…', '(2), (3), (5), (4), (1)', '(2), (3), (4), (5), (1)', '(5), (3), (2), (4), (1)', '(2), (4), (5), (3), (1)', '(2), (3), (4), (5), (1)'),
(43, 'N01', 'Bahasa Indo', '', 'Perhatikan silogisme berikut ini!\r\nPU = …\r\nPK = Polisi adalah aparat keamanan\r\nK = Polisi melindungi masyarakat\r\n\r\nPremis umum yang tepat untuk penalaran di atas adalah …', 'Seluruh aparat keamanan melindungi masyarakat.', 'Semua polisi pengayom masyarakat.', 'Semua polisi harus melindungi masyarakat.', 'Semua aparat keamanan selalu berbuat baik pada masyarakat.', 'Seluruh aparat keamanan melindungi masyarakat.'),
(44, 'N01', 'Bahasa Indo', '', ' Bacalah paragraf berikut dengan saksama!\r\nManajer perusahaan multiproduk itu berasal dari kalangan elit. Ia dalam manajemennya selalu menggunakan sistem kontrak.\r\nDalam paragraf di atas, terdapat kesalahan penulisan kata serapan, yakni…', 'manajer seharusnya manager', 'multiproduk seharusnya multiprodak', 'elit seharusnya elite', 'sistem seharusnya sistim', 'elit seharusnya elite'),
(45, 'N01', 'Bahasa Indo', '', 'Bacalah kalimat-kalimat berikut dengan saksama!\r\n(1) Budaya jalan pintas adalah manifestasi etos kerja yang kurang baik.\r\n(2) Seseorang yang memiliki etos kerja yang baik selalu mempunyai kemauan yang kuat untuk menghasilkan yang terbaik salam pekerjaannya.\r\n(3) Ada orang yang memiliki etos kerja yang baik dan ada pula yang kurang baik.\r\n(4) Sebaliknya, orang yang memiliki etos kerja yang kurang baik selalu mempunyai keinginan untuk mencari jalan termudah dalam melaksanakan suatu pekerjaan.\r\n\r\nKeempat kalimat di atas dapat disusun menjadi paragraf yang baik dengan\r\nurutan…', '3 – 2 – 4 – 1', '2 – 3 – 1 – 4', '4 – 2 – 3 – 1', '1 – 4 – 3 – 2', '3 – 2 – 4 – 1');

